trailingComments.value:
*
 * 获取客户端所有下载过的皮肤和当前使用皮肤（iOS only）(android 只有current的)
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @returns {Promise<Object>} 获取客户端所有下载过的皮肤和当前使用皮肤
 *
 *  @example
 * libSQ.exec('get-skin-list').then((info) => {
 *   alert(`[get-app-skin-list][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[get-app-skin-list][error] ${JSON.stringify(err, null, 2)}`);
 * });

